import styled from 'styled-components';

export const Container = styled.div`
  top: 0px;
  left: 0px;
  width: 1440px;
  height: 900px;
  background: #f5f5f5 0% 0% no-repeat padding-box;
  opacity: 1;
  display: block;
  flex-direction: column;

  header {
    margin-left: 120px;
    padding-top: 50px;
    width: 281px;
    height: 32px;

    h2 {
      text-align: right;
      letter-spacing: 0;
      color: #444444;
      opacity: 1;
    }

    button {
      margin: 5px 0 0;
    }
  }
`;
